import React from 'react'
import Navbar from '../sections/Navbar'
import Footer from '../sections/Footer'

const NotFoundView = () => {
  return (
    <>
      <Navbar/>

        <h1>404 - Page Not Found</h1>
      <Footer/>
      </>
  )
}

export default NotFoundView
